import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

import { LinkPage, NamePage } from "./interface";
import Logo from "../../Image/AUTO.png";

import classes from "./styles.module.css";

const pages = [
  { name: "Популярні авто", id: 1 },
  { name: "Автосалони", id: 2 },
  { name: "Тест-драйви", id: 3 },
  { name: "Скоро у продажу", id: 4 },
];

const Navbar = () => {
  const [activeChooseMenu, setActiveChooseMenu] = useState(null);
  let navigate = useNavigate();

  const chooseAdressLink = (page: any) => {
    if (page === NamePage.About) navigate(LinkPage.About);
    if (page === NamePage["How it works"]) navigate(LinkPage["How it works"]);
    if (page === NamePage.Blog) navigate(LinkPage.Blog);
    if (page === NamePage.Contacts) navigate(LinkPage.Contacts);
    if (page === NamePage.Profile) navigate(LinkPage.Profile);
    if (page === NamePage.Account) navigate(LinkPage.Account);
    if (page === NamePage.Dashboard) navigate(LinkPage.Dashboard);
    if (page === NamePage.Logout) navigate(LinkPage.Logout);
  };

  return (
    <div className={classes.container}>
      <img src={Logo} alt="" />
      <div className={classes.menuChoosePage}>
        <div className={classes.choosePage}>
          {pages.map((page) => (
            <span
              key={page}
              className={classes.chooseLink}
              onClick={() => {
                chooseAdressLink(page);
                setActiveChooseMenu(page.id);
              }}
            >
              {page}
            </span>
          ))}
        </div>
        <div></div>
      </div>
    </div>
  );
};

export default Navbar;
